/*Custom JS START*/
(function($) {

	$(window).on('load resize' , function() {
    	var sidebarWd = $('.sidebar').innerWidth();
		var headerhgt = $('.header').innerHeight();
		var winhgt = $(window).innerHeight();
		var sideHgt = winhgt - headerhgt;
		$('.content-sec').css('padding-left' , sidebarWd);
		$('body').css('padding-top' , headerhgt);
		$('.sidebar').css('height' , sideHgt);
    })

    $(window).on("load",function(){
        $(".content").mCustomScrollbar({
        	autoHideScrollbar : true,
        	dark: true
        });
    });
    
    
	
	$(document).ready(function() {
		/*Menu sidebar*/
		$('.nav-toggle').click(function() {
			$('body').toggleClass('sidebarMin');
		});

		/*For theme*/
		$('.btn-dark').click(function() {
			$('body').removeClass('light-theme');
		});
		$('.btn-light').click(function() {
			$('body').addClass('light-theme');
		});


		/*Card Slider*/
		$(".card-wrap").owlCarousel({
		  autoplay: false,
		  rewind: false,
		  margin: 20,
		  dots:false,
		  responsiveClass: true,
		  smartSpeed: 800,
		  nav: true,
		  items:5
		});

		/*Hero Slider*/
		$(".hero-slider").owlCarousel({
		  autoplay: true,
		  loop:true,
		  margin: 20,
		  dots:false,
		  responsiveClass: true,
		  smartSpeed: 800,
		  nav: true,
		  items:2,
		  autoWidth:true,
		  arrows:false
		});

		/*Like Heart*/
		$('.heart_logo').click(function() {
			if($(this).hasClass('liked')) {
				$(this).removeClass('liked');
			}
			else{
				$(this).addClass('liked');
			}
		});

		/*Custom select Box*/
		$('select').niceSelect();
		

		$('.svgImg img , .btn img').each(function() {
	        var $img = jQuery(this);
	        var imgID = $img.attr('id');
	        var imgClass = $img.attr('class');
	        var imgURL = $img.attr('src');
	        jQuery.get(imgURL, function(data) {
	            var $svg = jQuery(data).find('svg');
	            if (typeof imgID !== 'undefined') {
	                $svg = $svg.attr('id', imgID);
	            }
	            if (typeof imgClass !== 'undefined') {
	                $svg = $svg.attr('class', imgClass + ' replaced-svg');
	            }
	            $svg = $svg.removeAttr('xmlns:a');
	            if (!$svg.attr('viewBox') && $svg.attr('height') && $svg.attr('width')) {
	                $svg.attr('viewBox', '0 0 ' + $svg.attr('height') + ' ' + $svg.attr('width'))
	            }
	            $img.replaceWith($svg);
	        }, 'xml');
    	});

	});

	$(window).scroll(function() {
	});	


})(jQuery);
/*Custom JS END*/
